const Footer = () => {
    const anoAtual = new Date().getFullYear();

    return (
        <div id="footer">
			<div className="container">
				<div className="row">
					<div className="col-md-12">
						<p>{ anoAtual }. Por Jean Bitencourt.</p>
					</div>
				</div>
			</div>
		</div>
    );
}

export default Footer;
